/********************************************/
/************* Dark Gnome-Look **************/
/*********** Created By: tjwoosta ***********/
/********************************************/


@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("gnome-look.org")


{


/******************* MAIN ********************/


* {
background-color: #262626 !important;
background-image: none !important;
color: #999999 !important;
border-color: #3e3e3e !important;
}


/******************* TEXT ********************/


a:link, a:active, a:visited {
color: #8c5f24 !important;
}

a:hover {
color: #8a8a8a !important;
}


/****************** IMAGES ********************/


img[src*="/headers/header1_2_1.jpg"] {
width: 0px !important;
height: 89px !important;
background:url(data:image/png;base64,) no-repeat !important;
padding-left: 221px !important;
}

img[src*="/fresh-3.png"] {
width: 0px !important;
height: 19px !important;
background:url(data:image/png;base64,) no-repeat !important;
padding-left: 46px !important;
}

img[src*="/updated-3.png"] {
width: 0px !important;
height: 21px !important;
background:url(data:image/png;base64,) no-repeat !important;
padding-left: 61px !important;
}

img[src*="/premium.png"] {
width: 0px !important;
height: 21px !important;
background:url(data:image/png;base64,) no-repeat !important;
padding-left: 61px !important;
}

img[src*="/download.png"] {
width: 0px !important;
height: 22px !important;
background:url(data:image/png;base64,) no-repeat !important;
padding-left: 86px !important;
}


/************* BLANKED OUT IMAGES *************/


img[src*="/high_end_2.png"],
img[src*="high_begin_2.png"],
img[src*="/low_begin_1.png"],
img[src*="/low_begin_2.png"],
img[src*="/low_end_1.png"],
img[src*="/low_end_2.png"] {
